fun <T> ResultContent(result: Result<T>, emptyMessage: String = "No hay datos disponibles", errorTitle: String? = null, onRetry: () -> Unit? = null, modifier: Modifier = Modifier, contentEmpty: (T) -> Boolean = { data ->
        when (data) {
            is Collection<*> -> data.isEmpty()
            is Array<*> -> data.isEmpty()
            is Map<*, *> -> data.isEmpty()
            is String -> data.isBlank()
            null -> true
            else -> false
        }
    }, content: (T) -> Unit)

